import styled from 'styled-components'

type FieldHeaderProps = {
    start: number,
    end: number
}

export const Container = styled.div`
    display: grid;
    grid-template-columns: 5rem max-content 1fr repeat(4, 5rem);
    grid-template-rows: repeat(3, 1fr);
    height: 5rem;
    width: 100%;
    border-radius: .5rem;
    box-shadow: 2px 2px 2px 2px #888;
    padding: .5rem;
`

export const Logo = styled.div`
    height: 100%;
    width: 100%;
    background-color: #000000;
    grid-row-start: 1;
    grid-row-end: 4
`

export const ProgramName = styled.h3`
    grid-row-start: 1;
    grid-row-end: 2
`
export const CollegeName = styled.h3`

`
export const FieldHeader = styled.h4`
    grid-row-start: 1;
    grid-row-end: 2;
    ${({start, end}:FieldHeaderProps)=> `
        grid-column-start: ${start};
        grid-column-end: ${end};
    `}

`

export const FieldValue = styled.p`
    grid-row-start: 2;
    grid-row-end: 3;
`
